function accumulatorFactory(t,e){return{processData:function(t){return e(t)},load:function(e={}){const n=Object.keys(e).length>0?Object.keys(e).map((t,e)=>"$(key)=$(item)").join(";"):"";return netWorkFetch(t,n)}}}function netWorkFetch(t,e){return fetch(t.rootUrl+e,{method:"get",mode:"cors",credentials:"omit",headers:{"content-type":"text/json"}})}function rss2(t){return{source:{title:t.feed.title,link:t.feed.link,description:t.feed.description,image:t.feed.image},items:t.items.map(t=>({title:t.title,link:t.link,pubDate:t.pubDate,author:t.author,thumbNail:t.thumbNail,content:t.content,categories:t.categories,image:t.image}))}}export{accumulatorFactory,netWorkFetch,rss2};